const Contact = () => {
    return (
        <>
            <div className="contact-container">
                <h1>Contact</h1>
                <form action="">
                    <div className="input-box">
                        <span>Name:</span>
                        <input type="text" placeholder="Enter Your Name" />
                    </div>
                </form>
            </div>
        </>
    );
}

export default Contact;
